    <script>
        window.onload = function () {
            var main = document.querySelector("#LDP");
            main.style.stroke = "white";



            var subPaths = document.querySelectorAll("path");

            subPaths.forEach(subPath => {
                var subLength = subPath.getTotalLength();
                subPath.style.strokeDasharray = subLength;
                subPath.style.strokeDashoffset = subLength;

                subPath.getBoundingClientRect();

                subPath.style.transition = subPath.style.WebkitTransition =
                    'stroke-dashoffset 3s ease-in-out';

                subPath.style.strokeDashoffset = '0';
            });

            setTimeout(() => {
                document.querySelector(".loadingpage").style.opacity = "0";
                document.querySelector(".loadingpage").style.zIndex = "-100";
            }, 3000)

            // mainPath.style.strokeDasharray = mainLength;

            // mainPath.style.transition = mainPath.style.WebkitTransition =
            //     'stroke-dashoffset 3s ease-in-out';

            // mainPath.style.strokeDashoffset = '0';
        }
    </script>

    <script>
        // Custom JS codes

        function showTime() {
            var date = new Date();
            var h = date.getHours(); // 0 - 23
            var m = date.getMinutes(); // 0 - 59
            var s = date.getSeconds(); // 0 - 59
            var session = "AM";

            if (h == 0) {
                h = 12;
            }

            if (h > 12) {
                h = h - 12;
                session = "PM";
            }

            h = (h < 10) ? "0" + h : h;
            m = (m < 10) ? "0" + m : m;
            s = (s < 10) ? "0" + s : s;

            var time = h + ":" + m + ":" + s + " " + session;
            document.getElementById("enter-footer-clock").innerText = time;
            document.getElementById("enter-footer-clock").textContent = time;

            setTimeout(showTime, 1000);

        }

        showTime();

    </script>
